/*Table structure for table `tbl_day` */

DROP TABLE IF EXISTS `tbl_day`;

CREATE TABLE `tbl_day` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `english` varchar(100) NOT NULL DEFAULT '',
  `spanish` varchar(100) NOT NULL DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_day` */

insert  into `tbl_day`(`id`,`english`,`spanish`) values (1,'Monday','Lunes '),(2,'Tuesday','Martes'),(3,'Wednesday','Miércoles'),(4,'Thursday','Jueves'),(5,'Friday','Viernes'),(6,'Saturday','Sábado'),(7,'Sunday','Domingo');

/*Table structure for table `tbl_discount` */

DROP TABLE IF EXISTS `tbl_discount`;

CREATE TABLE `tbl_discount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `supermarket` int(11) NOT NULL,
  `day` int(11) NOT NULL,
  `payment_type` varchar(200) NOT NULL DEFAULT '',
  `discount` varchar(200) NOT NULL DEFAULT '',
  `description` text NOT NULL,
  `more` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_discount` */

/*Table structure for table `tbl_favourites` */

DROP TABLE IF EXISTS `tbl_favourites`;

CREATE TABLE `tbl_favourites` (
  `id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `product_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

